  render() {
    return (
      <div className="section-wrapper">
        <MainText label="Field size:" />
        <DropDown
          data={['Mongolian Steppe', 'European Average', 'Belorusian Magic']}
        />
        <MainText label="Game duration:" />
        <MainText label="Yield:" />
      </div>
    );
  }
}

export default GameSettings;
